import React, { useState } from 'react';
import './Testimonials.css';
import googlelogo from './Pictures/Googleimage.png';

const testimonials = [
  {
    name: "Liam Jaxon",
    date: "2023-10-11",
    rating: 5,
    text: "Brick Tech removed an old, poorly-pitched metal A/C sleeve on the 2nd story of a brick house. It leaked inside the house. Performed masonry work to repair brickwork and properly inserted the sleeve.",
    avatar: "L",
    color: "#00796b"
  },
  {
    name: "James Turner",
    date: "2023-10-11",
    rating: 5,
    text: "Asad and his crew are very professional. The work was done beautifully and done quickly. His rates are very reasonable. I would definitely recommend Brick Tech to those who are searching for Masonry work.",
    avatar: "J",
    color: "#d32f2f"
  },
  {
    name: "Mario Andretti",
    date: "2023-10-10",
    rating: 5,
    text: "I hired Asad and his team for brick paver installation, and I couldn't be happier with the results. Their professionalism, attention to detail, and work exceeded our expectations.",
    avatar: "M",
    color: "#1976d2"
  },
  {
    name: "Mohd Salim",
    date: "2023-10-09",
    rating: 5,
    text: "Excellent work done by Brick Tech team.",
    avatar: "M",
    color: "#f57c00"
  },
  {
    name: "Anthony Luca",
    date: "2023-10-11",
    rating: 5,
    text: "Great team with professional services.",
    avatar: "A",
    color: "#388e3c"
  },
  {
    name: "A Google User",
    date: "2023-10-10",
    rating: 5,
    text: "Good service and communication.",
    avatar: "A",
    color: "#455a64"
  },
  {
    name: "Jordan Addison",
    date: "2023-10-10",
    rating: 5,
    text: "Hiring Asad and his team from Brick Tech for our driveway concrete pouring was a wise decision. They completed the job on schedule and left the site in excellent condition. Our new driveway looks fantastic.",
    avatar: "J",
    color: "#8e44ad"
  },
  {
    name: "Larry Brown",
    date: "2023-10-10",
    rating: 5,
    text: "Great service. Asad and his team did a fabulous job on our walkway. I would highly recommend him to others.",
    avatar: "L",
    color: "#2c3e50"
  },
  {
    name: "Dylan Ezekiel",
    date: "2023-10-11",
    rating: 5,
    text: "We had the brick foundation of our house repaired and waterproofed/painted. Asad and his crew did great work. They provided an estimate right away along with excellent service.",
    avatar: "D",
    color: "#2980b9"
  },
  {
    name: "Jeremy Strong",
    date: "2023-10-10",
    rating: 5,
    text: "When it came time to replace the flat roof on our house, we hired Asad and his team, and it was a great decision. They executed the job on time and left the site in impeccable condition. Our roof looks amazing now.",
    avatar: "J",
    color: "#c0392b"
  }
];

const Testimonials = () => {
  const [visibleTestimonials, setVisibleTestimonials] = useState(8);

  const loadMoreTestimonials = () => {
    setVisibleTestimonials((prevVisible) => prevVisible + 3);
  };

  return (
    <section className="testimonials-section">
      <h2>Testimonials</h2>
      <h3>United With Our Customers</h3>
      <div className="ratings">
        EXCELLENT <span className="stars">â˜…â˜…â˜…â˜…â˜…</span> 141 reviews on
        <span className="google">
          <span className="g">G</span>
          <span className="o1">o</span>
          <span className="o2">o</span>
          <span className="g">g</span>
          <span className="l">l</span>
          <span className="e">e</span>
        </span>
      </div>
      <div className="testimonials-container">
        {testimonials.slice(0, visibleTestimonials).map((testimonial, index) => (
          <div key={index} className="testimonial-card" style={{ animationDelay: `${index * 0.2}s` }}>
            <div className="avatar" style={{ backgroundColor: testimonial.color }}>{testimonial.avatar}</div>
            <img src={googlelogo} alt="Google logo" className="google-logo" />
            <div className="testimonial-content">
              <h4>{testimonial.name}</h4>
              <p className="date">{testimonial.date}</p>
              <div className="rating">
                {"â˜…".repeat(testimonial.rating)}
              </div>
              <p>{testimonial.text}</p>
            </div>
          </div>
        ))}
      </div>
      {visibleTestimonials < testimonials.length && (
        <button className="load-more-btn" onClick={loadMoreTestimonials}>Load More</button>
      )}
    </section>
  );
};

export default Testimonials;
